
var KalturaNotificationService={register:function(identifier,type){var kparams=new Object();kparams.identifier=identifier;kparams.type=type;return new KalturaRequestBuilder("notification","register",kparams);},sendPush:function(userId,pushMessage){var kparams=new Object();kparams.userId=userId;kparams.pushMessage=pushMessage;return new KalturaRequestBuilder("notification","sendPush",kparams);},setDevicePushToken:function(pushToken){var kparams=new Object();kparams.pushToken=pushToken;return new KalturaRequestBuilder("notification","setDevicePushToken",kparams);}}